import './App.css';

function App() {
  return (
 <>
 <div>
<ReactTyped
  typedRef={typedRef()}
  loop
  typeSpeed={50}
  backSpeed={20}
  strings={["welcome to react-typed", "This is a react component that wraps up the <a hre…", ]}
  smartBackspace
  shuffle={false}
  backDelay={1}
  fadeOut={false}
